from stw_py_api_runtime.gen_classes.types.enum_type import EnumType
from stw_gen_sample3_api.basic_types import *


class Status(EnumType):
    """Статус теста"""

    @classmethod
    def _base_type(cls):
        return uint8_t

    # Тест пройден
    Ok = 0
    # Тест не производился
    NotPerformed = 1
    # Ошибка при попытке записи данных
    WriteError = 2
    # Ошибка при попытке чтения данных
    ReadError = 3
    # Ошибка проверки данных
    VerificationError = 4
